"210946":{"id":"210946","name":"Onmyoji","slug":"onmyoji","original_title":"陰陽師","overview":"No enclave do palácio imperial, Hiromasa Minamoto faz amizade com o místico Seimei Abe. Juntos, eles resolvem casos difíceis do reino demoníaco.","first_air_date":"2023-11-28","episode_run_time":0,"vote_average":6.7,"number_of_seasons":1,"number_of_episodes":13,"created_by":[],"production_companies":["Marvy Jack"],"genres":["Animação","Drama","Sci-Fi & Fantasy","Mistério"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/vJYAOcccsGLkKmuVx5qgqw3CgG7.jpg","poster_path":"https://image.tmdb.org/t/p/original/2tFbeZRrSnP3pUBmXU9MxAtQpLk.jpg","cast":["Daisuke Namikawa","浅沼晋太郎","Yui Ishikawa","浜田賢二","岸尾だいすけ"],"trailer":"-wE3ldlEr5o","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/rJIPHzoCAZDRBMLMWTprCgoxPCc.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/rJIPHzoCAZDRBMLMWTprCgoxPCc.jpg","air_date":"2023-11-28","episode_count":13,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"O demônio a caminho","overview":"Ao voltar de um encontro tarde da noite, Lorde Narihira e seu cortejo veem um carro de boi se aproximar, só que sem os bois.","air_date":"2023-11-28","runtime":27,"still_path":"https://image.tmdb.org/t/p/original/5x1KrMgEpm8qHsuSmmKIDgBLJf6.jpg","vote_average":0},"2":{"name":"Ministro cabeça","overview":"Após receber uma oferta de um demônio para conhecer uma mulher de \"beleza inigualável\", um lorde libertino busca a ajuda de Seimei.","air_date":"2023-11-28","runtime":27,"still_path":"https://image.tmdb.org/t/p/original/lznRdepkUxnl6NS5uADOG3gUpUo.jpg","vote_average":0},"3":{"name":"Doman Ashiya","overview":"Uma idosa busca ajuda de Seimei afirmando ter sido enviada por uma rata com asas. A pequena Kujo e a Sra. Fujiko começam a ter comportamentos estranhos.","air_date":"2023-11-28","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/gdwhP5Jwh4LCvdUR3SjaryHygEJ.jpg","vote_average":0},"4":{"name":"O amor está no ar","overview":"O espírito vingativo de um poeta falecido chamado Tadami assombra a região, mas ele é praticamente inofensivo… ou era até agora.","air_date":"2023-11-28","runtime":27,"still_path":"https://image.tmdb.org/t/p/original/4cQbWAeF40sFskOvGfsl6LgR5N3.jpg","vote_average":0},"5":{"name":"Paixão","overview":"Ao conversar com o pai de Tadami, Seimei e Hiromasa descobrem que ele teve uma experiência com um demônio anos antes de morrer.","air_date":"2023-11-28","runtime":27,"still_path":"https://image.tmdb.org/t/p/original/6yBay7sPYyX40WQ4QJf2daESdxp.jpg","vote_average":0},"6":{"name":"Amor por insetos","overview":"Lorde Tachibana consulta Doman Ashiya para curar a filha de seu amor por insetos, mas Seimei não acredita no remédio indicado.","air_date":"2023-11-28","runtime":27,"still_path":"https://image.tmdb.org/t/p/original/qeFktzZZ3NXRZUi7VmBStmKu6u9.jpg","vote_average":0},"7":{"name":"Reunião animada","overview":"Hiromasa leva uma cesta de cogumelos para comer com Seimei, mas o encontra totalmente focado em identificar alguns insetos verdes mortos.","air_date":"2023-11-28","runtime":26,"still_path":"https://image.tmdb.org/t/p/original/so0Ztv4Ne7sgsC5ZytXgrbaWHxX.jpg","vote_average":0},"8":{"name":"Filho da raposa","overview":"Ao cuidar de Seimei, Hiromasa têm visões da infância do amigo e das dificuldades que ele teve por ser tão diferente e talentoso.","air_date":"2023-11-28","runtime":26,"still_path":"https://image.tmdb.org/t/p/original/jYpP9DYy3NflE5tte6HMNRkg2t2.jpg","vote_average":0},"9":{"name":"Um campeonato de magia na corte imperial","overview":"A Princesa Tsuyuko suspeita que uma pessoa improvável seja meio-demônio. Seimei enfrenta Doman Ashiya para ver quem é o melhor onmyoji.","air_date":"2023-11-28","runtime":27,"still_path":"https://image.tmdb.org/t/p/original/a6fSPFi77MPsukl4v1IJkaQBkMs.jpg","vote_average":0},"10":{"name":"Maldição perdida","overview":"Para irritação de todos, Seimei tem visitado membros da corte imperial no meio da noite em busca do demônio que o atacou.","air_date":"2023-11-28","runtime":27,"still_path":"https://image.tmdb.org/t/p/original/nk7bbUSze5MwhLdocQUz6PEWbIP.jpg","vote_average":0},"11":{"name":"Metamorfose","overview":"Atsumi tem uma mudança drástica e reveladora. Como Seimei tem dificuldade para aceitar os eventos recentes, Yasunori o presenteia com um objeto que lhe traz esperança.","air_date":"2023-11-28","runtime":26,"still_path":"https://image.tmdb.org/t/p/original/5KoaGN2FlCip5uhWZXDGBVs0KH5.jpg","vote_average":0},"12":{"name":"A cerimônia","overview":"Com ajuda de Doman Ashiya, Seimei inicia a Cerimônia do Senhor Taizan. O som familiar de uma flauta se destaca.","air_date":"2023-11-28","runtime":26,"still_path":"https://image.tmdb.org/t/p/original/2fFmUW2cKxXpJpDLdNH9OGAYMD.jpg","vote_average":0},"13":{"name":"O demônio interior","overview":"Ao ser consumido por forças sombrias, Atsumi tem flashbacks de sua longa e duradoura amizade com Hiromasa.","air_date":"2023-11-28","runtime":26,"still_path":"https://image.tmdb.org/t/p/original/o7ZtJQNLkzTIrwSYo9GKlmAZJUh.jpg","vote_average":0}}}}},
