"239779":{"id":"239779","name":"True Beauty","slug":"true-beauty","original_title":"여신강림","overview":"Jugyeong, que consegue se transformar com maquiagem, decide se transferir para o Colégio Saebom visando deixar seu passado de bullying para trás. O colégio é conhecido por produzir idols, atores e influenciadores digitais, tudo graças à sua tradição única de votação anônima para a escolha da deusa da Beleza Verdadeira. A estudante escolhida é recrutada por agências de entretenimento. Jugyeong rapidamente se torna o centro das atenções, ganhando o título de próxima candidata e começa a conviver com Sujin, que já foi deusa de Beleza Verdadeira duas vezes. No entanto, a fachada amigável de Sujin esconde uma intenção maliciosa. Ela pretende derrubar Jugyeong usando táticas e armadilhas astutas! Determinada a não ser uma vítima novamente, Jugyeong confronta Sujin, prometendo se tornar a próxima deusa. Ela se envolve em uma feroz guerra de votos enquanto esconde seu rosto sem maquiagem.","first_air_date":"2024-08-07","episode_run_time":19,"vote_average":8.3,"number_of_seasons":1,"number_of_episodes":13,"created_by":[],"production_companies":["Studio N","Cocktail Media","Grida Animation Studio","Naver Webtoon"],"genres":["Animação","Comédia"],"certification":"14","backdrop_path":"https://image.tmdb.org/t/p/original/yNQT7fVLhopmytPytN6VVPgrMoX.jpg","poster_path":"https://image.tmdb.org/t/p/original/9gpc8kIhNEG7r0VTkyI9aVBxdO3.jpg","cast":[],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/9gpc8kIhNEG7r0VTkyI9aVBxdO3.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/9gpc8kIhNEG7r0VTkyI9aVBxdO3.jpg","air_date":"2024-08-07","episode_count":13,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Surge uma deusa?","overview":"Ju Gyeon, que sofre bullying por ser feia, encontra uma nova oportunidade quando muda de escola. Com a ajuda de maquiagem, ela cria uma nova identidade, mas um novo aluno parece saber seu segredo…","air_date":"2024-08-07","runtime":20,"still_path":"https://image.tmdb.org/t/p/original/fekSKRH6uxndjwqUoemA0ZSTdzP.jpg","vote_average":0},"2":{"name":"Me ferrei...","overview":"As coisas não vão bem para Ju Gyeong. Para manter seu segredo, Suho faz dela sua assistente pessoal e faz fazer tarefas para ele. Se isso não fosse o bastante, ela acaba encontrando pessoas desagradáveis do seu passado…","air_date":"2024-08-14","runtime":19,"still_path":"https://image.tmdb.org/t/p/original/eYwLrZGyXfPefYQCTA2aGzk9ASp.jpg","vote_average":0},"3":{"name":"O Bastardo e o Delinquente","overview":"Um grupo da escola designa Ju Gyeong para tentar contato com Seojun Han, um renomado delinquente, que faz de tudo menos colaborar. Além disso, Ju Gyeong encara outro desafio: transformar alguém com o poder da maquiagem!","air_date":"2024-08-21","runtime":20,"still_path":"https://image.tmdb.org/t/p/original/p5yRxX6ssILLVH5pMgqwaz9Eou1.jpg","vote_average":0},"4":{"name":"Uma crise sem fim","overview":"Ju Gyeong lida com a pressão da primeira missão de candidata à deusa, enquanto começa a explorar um novo relacionamento com um segredo muito suspeito.","air_date":"2024-08-28","runtime":19,"still_path":"https://image.tmdb.org/t/p/original/72WFnZcM6KVQXzedrvd82iqPStr.jpg","vote_average":0},"5":{"name":"Acho que tudo mudaria se eu fosse bonita...","overview":"Ju Gyeong equilibra sua vida amorosa e desafios, enquanto Suho descobre segredos perturbadores sobre Jung Hyun Woo, um estudante problemático. A tensão aumenta quando Ju Gyeong é surpreendida por Suho e Seojun em um momento inesperado, revelando a verdadeira natureza de Hyun Woo.","air_date":"2024-09-04","runtime":19,"still_path":"https://image.tmdb.org/t/p/original/w8DCfL1qQIq0gIRViWmfqMWc0nR.jpg","vote_average":0},"6":{"name":"This Too Shall Pass Away","overview":"Depois de discutir com Seojun, Suho reflete sobre o peso das suas emoções e a perda do seu amigo Seyeon. Ju Gyeong presencia a cena e tenta consolá-lo, incentivando-o a liberar sua dor de uma forma não convencional. Mas antes que possam processar tudo o que estão sentindo, são interrompidos por más notícias.","air_date":"2024-09-11","runtime":18,"still_path":"https://image.tmdb.org/t/p/original/lNMt1efMPxLnOFyy0ut04szVGJW.jpg","vote_average":0},"7":{"name":"Não posso gostar?","overview":"Ju Gyeong, Seojun e Suho se aproximam cada vez mais e até tiram fotos juntos para uma revista de moda. Isso acaba revelando uma nova dinâmica entre o trio e abrindo os olhos de Ju Gyeong para os seus sentimentos. Mas, ao vagar pela noite, ela testemunha uma situação que a deixa abalada.","air_date":"2024-09-18","runtime":19,"still_path":"https://image.tmdb.org/t/p/original/hjvcTJpa2QFqOXkDulgOMjHkQBt.jpg","vote_average":0},"8":{"name":"Não se engane","overview":"A competição da deusa esquenta entre Ju Gyeong e Sujin, que recebem a missão de estilizar seus uniformes. Mas algo inesperado acontece, forçando Ju Gyeong a improvisar um plano B. Quando as fotos são publicadas, suas amigas logo percebem que tem algo errado. Enquanto isso, o segredo dela corre o risco de ser descoberto.","air_date":"2024-09-25","runtime":19,"still_path":"https://image.tmdb.org/t/p/original/6XzmF4ly98hEDVf2VL6s8Na3oC2.jpg","vote_average":0},"9":{"name":"Verdade ou desafio","overview":"Sua confronta Sujin na escola, acusando ela de ter roubado a roupa da missão da Ju Gyeong. As meninas buscam montar uma estratégia contra Sujin em uma festa do pijama. Ju Gyeong, temendo que suas amigas descubram seu rosto sem maquiagem, luta com suas próprias inseguranças. Será que ela irá mostrar seu verdadeiro rosto na festa?","air_date":"2024-10-02","runtime":18,"still_path":"https://image.tmdb.org/t/p/original/cmph9p4k1f8csjr5XiIXhlGVNPn.jpg","vote_average":0},"10":{"name":"Eu vou me confessar","overview":"Suho confronta Seojun ao perguntar se ele gosta de Ju Gyeong. Ambos admitem ter sentimentos por ela, discutindo quem será o primeiro a se confessar - o que aumenta a tensão entre eles. Enquanto isso, Ju Gyeong reflete sobre seus sentimentos e pondera se deve ou não confessar seu amor, temendo que isso possa arruinar sua amizade. Mas uma inesperada revelação vai mudar tudo.","air_date":"2024-10-09","runtime":19,"still_path":"https://image.tmdb.org/t/p/original/4hYHjggWH1OmFO7TA4m3YFYIZ10.jpg","vote_average":0},"11":{"name":"Eleição da Deusa ao Vivo","overview":"Ju Gyeong desabafa com Sua e Chaerin sobre suas inseguranças, recebendo apoio delas. Então, começa a missão final para decidir quem será a deusa. As candidatas devem disputar votos do público durante uma live. Ju Gyeong aparece atrasada e pronta para revelar a verdade durante o \"confronto\". Mas esse não será a única batalha do seu dia.","air_date":"2024-10-16","runtime":19,"still_path":"https://image.tmdb.org/t/p/original/zhdUheTopeI5ZTxQ3zZHFSH3ZJZ.jpg","vote_average":0},"12":{"name":"Eleição da Deusa ao Vivo (2)","overview":"Semi está determinada a destruir Ju Gyeong e propõe uma aliança com Sujin para expor o verdadeiro rosto dela. Ela hesita, temendo ser vista como vilã, mas Semi a convence: uma amiga de Ju Gyeong está disposta a ajudar. Enquanto o plano delas se desenrola, a votação vai chegando ao fim e a verdade vem à tona.","air_date":"2024-10-23","runtime":19,"still_path":"https://image.tmdb.org/t/p/original/m305jwiOPGyk1fhlJnFasqHSr0B.jpg","vote_average":0},"13":{"name":"Nosso primeiro amor","overview":"Ju Gyeong sente que sua vida está prestes a mudar de forma irreversível. Após construir amizades verdadeiras e enfrentar o medo de se mostrar como realmente é, ela se prepara para finalmente confessar seus sentimentos para Lee Suho. Mas uma reviravolta faz ela se questionar se o momento é realmente certo e que, às vezes, o coração guarda segredos que nem ela mesma compreende.","air_date":"2024-10-30","runtime":18,"still_path":"https://image.tmdb.org/t/p/original/rgXYldSo9YPZnPe8gY2C2rJiVaw.jpg","vote_average":0}}}}},
