"153450":{"id":"153450","name":"Migi&Dali","slug":"migi-dali","original_title":"ミギとダリ","overview":"Após finalmente conseguirem adotar uma criança, os Sonoyama não estavam preparados para o mistério que logo se desvendaria. Hitori parece ser o filho perfeito para seus pais amorosos. Ele é bonito, inteligente e grato pela nova vida luxuosa que ganhou, mas ele guarda um segredo sombrio. Hitori, na verdade, são os gêmeos Migi e Dali fingindo ser um único garoto. E eles têm um motivo aterrorizante por trás dessa identidade oculta.","first_air_date":"2023-10-02","episode_run_time":24,"vote_average":6.5,"number_of_seasons":1,"number_of_episodes":13,"created_by":[],"production_companies":["GEEKTOYS","CompTown","Nikkatsu Corporation","NetEase Games","AT-X","FlyingDog","Sotsu","LIVE VIEWING JAPAN","Bit grooove promotion","Toei Video Company","TIME"],"genres":["Animação","Comédia","Mistério"],"certification":"14","backdrop_path":"https://image.tmdb.org/t/p/original/sTnKX862YdnrLzhtAlzqGIYoHZs.jpg","poster_path":"https://image.tmdb.org/t/p/original/iSfjTea4v1Gf7EwcEcewmXTdg42.jpg","cast":["Shun Horie","Ayumu Murase"],"trailer":"lsGlKp4xlFg","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/wON2aUSycTDWINVFv8ES78QOPIV.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/wON2aUSycTDWINVFv8ES78QOPIV.jpg","air_date":"2023-10-02","episode_count":13,"overview":"N/A","vote_average":9.5,"episodes":{"1":{"name":"Migi e Dali","overview":"Um casal idoso decide adotar uma criança e, após algumas visitas ao orfanato, escolhem adotar Hitori. Porém, o que eles não esperavam, e continuam sem saber, é que acabaram adotando gêmeos.","air_date":"2023-10-02","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/hHkhP5CNkh1ykHde6xvDbvMcuZL.jpg","vote_average":6},"2":{"name":"Festa de Boas-vindas","overview":"Depois de serem adotados pelo casal Sonoyama, Migi e Dali continuam fingindo ser Hitori. Porém, quando o casal dá uma saída, eles aproveitam para explorar melhor a casa e descobrir possíveis podres de seus pais adotivos.","air_date":"2023-10-09","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/4eMCrQ9rr3wPH5DTlXvCghNKrxS.jpg","vote_average":10},"3":{"name":"Vamos Fazer Amigos","overview":"Os pais de Hitori querem que ele entre pros escoteiros para fazer amigos. A princípio, Migi e Dali são contra a ideia, mas logo percebem que é uma ótima forma de ter acesso às casas das pessoas da vila para investigar a morte da mãe.","air_date":"2023-10-16","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/goLbi4007PQjDfUTPcUKlIc9fXI.jpg","vote_average":10},"4":{"name":"Vamos Nos Tornar um Bom Aluno","overview":"Depois de um truque de engenharia social, Migi e Dali descobrem que a casa dos Ichijo tem um papel de parede com a estampa da memória deles. Para investigar, eles precisam se aproximar do Eiji, mas, para isso, vão ter que estudar pesado para ficarem na mesma turma dele na escola.","air_date":"2023-10-23","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/mI27RyviRP2nE4FfrQmgbG35QVo.jpg","vote_average":10},"5":{"name":"A Canção da Pulga-d'água","overview":"A família Ichijo convida os Sonoyama para a casa deles para celebrar o desempenho de Hitori nas provas. Ou, pelo menos, esse é o pretexto. Reiko acusa Hitori de roubar, e Eiji procura pelo botão com um floco de neve de seu antigo pijama.","air_date":"2023-10-30","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/ptBr8EEn1SrlSRiH3tHjjAs8Q4w.jpg","vote_average":10},"6":{"name":"Quem Matou o Pássaro?","overview":"O programa de recuperação de Hitori da Reiko Ichijo envolve criá-lo de novo desde bebê. Apesar da situação, Migi percebe que essa é a forma ideal de ser considerado um verdadeiro membro da família Ichijo e decide entrar de cabeça na personagem.","air_date":"2023-11-06","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/qUBWegjlQZYSArBXRZOK5OBHaPf.jpg","vote_average":10},"7":{"name":"Não Era um Fantasma","overview":"Para que possam entender a verdade por trás da morte da mãe, Dali decide interrogar Eiji diretamente sobre o que aconteceu na noite de Natal de quando ele tinha 5 anos. Sem poder interrogar como Hitori, ele decide usar outra abordagem.","air_date":"2023-11-13","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/azhGKN8gquz3z7h4yPKQdplocLi.jpg","vote_average":10},"8":{"name":"Dois Não é Igual a Um","overview":"Depois que percebeu que Sali era Dali, Migi foi viver escondido na casa do Akiyama. Dali vai lá para convencê-lo a voltar, mas Migi já está decidido que não vai mais levar a vingança pela morte da mãe adiante. Agora, Dali continua a missão sozinho.","air_date":"2023-11-20","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/4pjjgg61viUHkRmcVW9tjc6fNpj.jpg","vote_average":10},"9":{"name":"Matar Matar Matar Matar","overview":"Sem entender por que Eiji o salvou, Migi se veste de Sali e vai visitá-lo para perguntar diretamente. Chegando lá, Eiji mostra a maquete do sótão a ele e explica que a mãe está fazendo de tudo para esconder o segredo de que ele empurrou a mãe dos gêmeos da janela.","air_date":"2023-11-27","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/tq2JjbQcq9Jc7ZkbgSNe2HexteK.jpg","vote_average":0},"10":{"name":"Castores vs Mãe Ichijo","overview":"Ao voltarem para Origon, Migi e Dali logo percebem que estão sendo procurados pela polícia e não podem mais agir como sempre. Eles resolvem pedir ajuda a Akiyama, que chama uma pessoa inesperada a bordo do plano para expor a verdade por trás da família Ichijo.","air_date":"2023-12-04","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/epD1JlMH0Eyv4ToWdk7jYHtWdVJ.jpg","vote_average":0},"11":{"name":"Uma Mulher Irracional","overview":"Enquanto Karen distrai o pai, Reiko Ichijo começa a contar a história de como conheceu Metry e o que aconteceu desde então. Segundo ela, sua vida totalmente perfeita começou a apresentar anomalias com a presença da mãe de Migi e Dali.","air_date":"2023-12-11","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/cqAaGa7UlAO5KRme7U31p5QOU6H.jpg","vote_average":0},"12":{"name":"Nossa Vingança","overview":"Enquanto tentam quebrar a porta para escapar do quarto onde foram trancados, Migi, Dali e os demais percebem que a casa está pegando fogo e têm que se apressar. No entanto, a situação parece desesperadora conforme eles vão ficando sem força e a fumaça começa a invadir.","air_date":"2023-12-18","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/6VWgSJ3MLapPn9qKqWh3Nqwqr8K.jpg","vote_average":0},"13":{"name":"Migi e Dali","overview":"Depois do incêndio na casa dos Ichijo, a polícia encontra a fita que Maruta gravou e, com a confissão de Eiji, ele é condenado a passar um tempo no reformatório. Como Dali queimou o rosto no incêndio, não pode mais trocar de papel com o Migi e decide continuar vivendo para sempre como a sombra dele.","air_date":"2023-12-25","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/eUeUhW4RoetGQxpXqziOsLFrUbC.jpg","vote_average":0}}}}},
